    void testCheckDigestWithSameInputs() {
        User user = new User();
        String input = "password";
        String salt = "salt";
        String digest = user.createDigest(salt.getBytes(), input);
        assertTrue(user.checkDigest(digest, input));
    }

    @Test
    void testCheckDigestWithDifferentSalt() {
        User user = new User();
        String input = "password";
        String salt1 = "salt1";
